import React from 'react'

function ContactList(){
    const Contact= [
        {
            "name" : "rajesh",
            "email" : "rajesh@gmail.com"
          },
          {
            "name" : "guru",
            "email" : "guru@gmail.com"
          }
    ];
    const Contacts = Contact.map((contact) => {
        return (
            <div>
                <h4>{contact.name}</h4>
                <h6>{contact.email}</h6>
            </div>
        );
    });
    return (
        <div>
            <h3>Contacts</h3>
            {Contacts}
        </div>
    );
}
export default ContactList;
